import React from "react";
import "./recommender.css";

function Recommender() {
  return (
    <div className="whitebox">
   
      <h2>Select your body type</h2>
      <p>Unsure of your body type? <a href="/calculator">Use our calculator!</a></p>
      <div className="grid-container">
        <div className="grid-item"><img src="../images/hourglass.png" alt="hourglass" /></div>
        <div className="grid-item"><img src="path/to/image2.png" alt="Body Type 2" /></div>
        <div className="grid-item"><img src="path/to/image3.png" alt="Body Type 3" /></div>
        <div className="grid-item"><img src="path/to/image4.png" alt="Body Type 4" /></div>
        <div className="grid-item"><img src="path/to/image5.png" alt="Body Type 5" /></div>
        <div className="grid-item"><img src="path/to/image6.png" alt="Body Type 6" /></div>
      </div>
      <button className="continue-button">CONTINUE</button>
    </div>
  );
}

export default Recommender;
